import image from './images/Big-Bowman-Pond.jpeg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <img src={image} className="lodge-image" alt="lodge on Big Bowman Pond" />
        <h1 className="App-header">Frontend stuff</h1>
      </header>
    </div>
  );
}

export default App;
